import React,{useState} from 'react'

export const Search = ({}) => {
    const [text, setText] = useState('')
    return (
        <section className="search">        
        <form>
            <input type="text" placeholder="Search Character" value={text} onChance={(e) => setText(e.target.value)}></input>
        </form>

        </section>
            
        
    )
}
